webpackJsonp([0xa1612eced6a7],{5237:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/04/blossom.jpg" height="320" width="240" border="0" alt="Blossom: " /></p>\n<p><i><b>Our first blossom in the garden. Spring is finally here. Thanks to Daylight Savings Time I can still see what\'s going on in the garden when I get home!</b></i></p>\n<p>Easter week. The spring German holidays coming up means a lot of 4-day work weeks; Good Friday, Easter Monday, May Day, Ascension, Pentecost. </p>\n<p>Mama just asked me where the past few page titles come from. Overload, from the Sugababes, and I\'m noteven halfway through the song yet.</p>',fields:{title:"I just had to get out of bed",date:"09 Apr 2001",url:"https://papascott.de/2001-04-09-i-just-had-to-get-out-of-bed/"}}},pathContext:{slug:"/2001-04-09-i-just-had-to-get-out-of-bed/",prev:{fields:{title:"Skipping school, gotta walk for air",date:"08 Apr 2001",slug:"/2001-04-08-skipping-school-gotta-walk-for-air/"}},next:{fields:{title:"I'm on overload in my head",date:"13 Apr 2001",slug:"/2001-04-13-im-on-overload-in-my-head/"}}}}}});
